import {useState, useEffect} from 'react';
import {Table} from 'antd';


const Bill = () => {

  const columns = [
    {
      title: "Mã hóa đơn",
      dataIndex: "MaHD",
      key: "MaHD",
    },
    {
      title: "Ngày mua",
      dataIndex: "NgayLap",
      key: "NgayLap",
    },
    {
      title: "Tổng tiền",
      dataIndex: "ThanhTien",
      key: "ThanhTien",
    },
    {
      title: "Tags",
      key: "tags",
      dataIndex: "tags",
     
    },
    {
      title: "Action",
      key: "action",
      render: (text, record) => (
          <a>Delete</a>
        
      ),
    },
  ];

  const data = [
    {
      key: "1",
      name: "John Brown",
      age: 32,
      address: "New York No. 1 Lake Park",
      tags: ["nice", "developer"],
    },
    {
      key: "2",
      name: "Jim Green",
      age: 42,
      address: "London No. 1 Lake Park",
      tags: ["loser"],
    },
    {
      key: "3",
      name: "Joe Black",
      age: 32,
      address: "Sidney No. 1 Lake Park",
      tags: ["cool", "teacher"],
    },
  ];


  return(
    <div>
      <Table columns={columns} dataSource={data} />
    </div>
  )
}

export default Bill;
